New Orleans: A Living Museum Of Music

Arts Documentary hosted by Wendell Pierce, published by PBS broadcasted as part of Great Museums series in 2010 - English narration


Information
------------------------------

GREAT MUSEUMS: NEW ORLEANS: A LIVING MUSEUM OF MUSIC is an intimate look at the traditions associated with New Orleans' music and the preservation of those traditions through the work of local musicians and educators who mentor young talent; museum curators who care for musical treasures; historians and archivists who research and document the stories; activists working to protect, heal and inspire the many musicians whose livelihoods were taken away by Katrina. All are committed to the preservation of the rich musical heritage of New Orleans, as well as the future of New Orleans music. &quot;The living museum is a manifestation of participation,&quot; proclaims Ellis Marsalis-revered jazz pianist, music educator, and patriarch of the Marsalis family jazz dynasty-who is featured in the program.

